import React from 'react'
import './ViewList.css'

$(document).ready(function(){

  var counter = 1;
  $('tr td table').each(function() {
  var expanel_id = 'expanel-' + counter;
   $(this).parent().parent().prev("tr").children("td.details-control").children("button").attr("aria-controls",expanel_id);
   $(this).parent().parent().attr("id",expanel_id);
   counter++;
   // Toggle the state properties
   $("button").click(function (){
   var state = $(this).attr("aria-expanded");
     if(state === "true")
     {
       $(this).attr("aria-expanded",'false');
     }
     else
     {
       $(this).attr("aria-expanded",'true');
     }
     $(this).parent().parent().next("tr").toggleClass( "hidden" );
     });
  });	
 });


const ViewList = () => {
  return (
    <div>
      <h1>Properties Table</h1>
      <table>
        <thead>
          <tr>
            <th scope="col">Compounds Index</th>
            <th scope="col">Compounds Materials</th>
            <th scope="col">Compounds Notation</th>
            <th scope="col">Compounds Mol2</th>
            <th scope="col">Detail...</th>
          </tr>
        </thead>
        <tbody>
          <tr className='even'>
            <th scope='row'>Hello1</th>
            <td>Hello2</td>
            <td>Hello3</td>
            <td>Hello4</td>
            <td className='detail-button'><button aria-expanded="false" aria-label="More details for Hello1">Details</button></td>
          </tr>
          <tr className='hidden'>
            <td colSpan="5">
              <table aria-label="Additional details for Hello1">
                <tbody>
                  <tr>
                    <th>Detail 1:</th>
                    <td>Hello in detail</td>
                  </tr>
                  <tr>
                    <th>Detail 2:</th>
                    <td>Hello in detail</td>
                  </tr>
                  <tr>
                    <th>Detail 3:</th>
                    <td>Hello in detail</td>
                  </tr>
                </tbody>
              </table>
            </td>
          </tr>
        </tbody>
      </table>
    </div>
  )
}

export default ViewList
